import React from "react";

function Main() {
  return (
    <main className={`container`}>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="Home" element={<Home />} />
        <Route path="FlagDetails" element={<FlagDetails />} />
      </Routes>
    </main>
  );
}

export default Main;
